import React from 'react'
import "./input.css"

const fN = document.getElementsByClassName("fn");
/*fN.addEventListener("keydown", function(event){

  if(event.keyCode === 13){
    let answerFN = document.querySelector("label > .fn").value
    console.log(answerFN)
  }
})
*/
const fNArray = Array.from(fN);

fNArray.forEach(element => {
  
  element.addEventListener("onkeydown", function (event){
    if (event.keyCode === 13){
      console.log(`Is your name ${fN[0].value} by any chance?`)
    }
  })

})
console.log(fNArray)
document.addEventListener("onkeydown", function (e){
  console.log(e.code)
})
console.log(document.onkeydown)


const Input =()=> {
  return (<>
  <label>First Name
  <input className='fn'/>
  </label>

  <label>Last Name
  <input className='ln'/>
  </label>

  <label>Email
  <input className='email'/>
  </label>

  <label>Phone
  <input className='phone'/>
  </label>

  <label>Password
  <input className='password'/>
  </label>
  
  <label>Confirm Password
  <input className='confpass'/>
  </label>

  </>)
}
export default Input;
